        private void RaceTrackModelCreating(ModelBuilder modelBuilder)
        {
            #region Mapping
            modelBuilder.Entity<RaceTrack>().ToTable("Tracks")
                .HasIndex(i => i.Code)
                .IsUnique();
            #endregion
            #region Relations
            modelBuilder.Entity<RaceTrack>()
            .HasMany(p => p.Competitions)
